import { View, Text, Image, TouchableOpacity } from "react-native";
import styles from "./style/resItem.style";
import React from "react";
import CommunityMaterialIcons from "react-native-vector-icons/Ionicons";
import {ITEMS} from './item.constants';

const RestaurantItemInfor = () => (
  ITEMS.map((item, index) => (
      <TouchableOpacity activeOpacity={0.5}>
        <View style={styles.resItemWrapper}>
          <Image source={img} style={styles.itemImg} />
          <CommunityMaterialIcons
            name="heart-outline"
            size={25}
            style={styles.heartIcon}
            color = 'white'
          />

        </View>
      </TouchableOpacity>
  ))
);

export default function RestaurantItem(props) {
  const img = require("../../assets/image/mixao.jpeg");
  return (
    <TouchableOpacity activeOpacity={0.5}>
      <View style={styles.resItemWrapper}>
        <Image source={img} style={styles.itemImg} />
        <CommunityMaterialIcons
          name="heart-outline"
          size={25}
          style={styles.heartIcon}
          color = 'white'
        />
        {RestaurantItemInfor()}
      </View>
    </TouchableOpacity>
  );
}
